INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (2.1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 130011, 1, 0.0, 2, 3001, "2030/01/01 14:59:59", 3001100, 100, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (5.68, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 130011, 4, 0.0, 2, 3001, "2030/01/01 14:59:59", 3001101, 101, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 130011, 1, 0.0, 1, 3001, "2030/01/01 14:59:59", 3001102, 102, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 130211, 1, 0.0, 1, 3002, "2030/01/01 14:59:59", 3002100, 100, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 130211, 1, 0.0, 1, 3002, "2030/01/01 14:59:59", 3002101, 101, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (8.53, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 130211, 5, 0.0, 2, 3002, "2030/01/01 14:59:59", 3002102, 102, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (5.67, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 130211, 7, 0.0, 1, 3002, "2030/01/01 14:59:59", 3002103, 103, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ", 130211, 1, 0.0, 1, 3002, "2030/01/01 14:59:59", 3002104, 104, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 130211, 3, 0.0, 3, 3004, "2030/01/01 14:59:59", 3002300, 300, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", 130211, 7, 0.0, 7, 3005, "2030/01/01 14:59:59", 3002400, 301, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (4.4, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ", 130211, 2, 0.0, 1, 3003, "2030/01/01 14:59:59", 3003200, 200, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ", 130211, 7, 0.0, 7, 3003, "2030/01/01 14:59:59", 3003201, 201, "2024/10/31 12:00:00", -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (5.6, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ", 130211, 1, 0.0, 2, 3003, "2030/01/01 14:59:59", 3003202, 202, "2024/10/31 12:00:00", -416.5);
